import React from 'react';
import { Search, CheckCircle } from 'lucide-react';
import { STATUS_COLORS } from '../utils/constants';

const StatusTracker = ({ trackerSearch, setTrackerSearch, trackerRequests, trackingData, setSelectedRequest }) => {
  return (
    <div className="space-y-6">
      <div className="bg-white rounded-xl shadow-lg p-6">
        <h2 className="text-2xl font-bold text-gray-800 mb-4 flex items-center">
          <Search className="mr-3 text-blue-600" />
          Advanced Status Tracker
        </h2>
        <input
          type="text"
          placeholder="Search by request number or type..."
          value={trackerSearch}
          onChange={(e) => setTrackerSearch(e.target.value)}
          className="w-full px-4 py-3 border-2 border-gray-300 rounded-lg focus:border-blue-500 focus:ring-2 focus:ring-blue-200"
        />

        <div className="mt-6 space-y-4 max-h-[600px] overflow-y-auto">
          {trackerRequests.map((req, idx) => {
            const timeline = trackingData.filter(t => t.service_request_number === req.service_request_number);
            return (
              <div 
                key={idx} 
                className="border-2 border-gray-200 rounded-lg p-4 hover:border-blue-400 transition-all cursor-pointer"
                onClick={() => setSelectedRequest(req)}
              >
                <div className="flex justify-between items-start mb-3">
                  <div>
                    <span className="text-lg font-bold text-blue-600">{req.service_request_number}</span>
                    <p className="text-gray-700 font-semibold">{req.service_request_type}</p>
                    <p className="text-sm text-gray-500">{req.location}</p>
                  </div>
                  <span className={`px-3 py-1 rounded-full text-sm font-bold ${STATUS_COLORS[req.status]}`}>
                    {req.status}
                  </span>
                </div>

                <div className="relative">
                  <div className="absolute top-5 left-3 w-0.5 h-full bg-gray-200"></div>
                  <div className="space-y-3">
                    {timeline.slice(0, 4).map((track, i) => (
                      <div key={i} className="flex items-start">
                        <div className="w-6 h-6 rounded-full bg-blue-500 flex items-center justify-center z-10">
                          <CheckCircle size={16} className="text-white" />
                        </div>
                        <div className="ml-4">
                          <p className="text-sm font-semibold text-gray-700">{track.status}</p>
                          <p className="text-xs text-gray-500">{new Date(track.updated_at).toLocaleString()}</p>
                        </div>
                      </div>
                    ))}
                  </div>
                </div>

                <div className="mt-4 grid grid-cols-3 gap-2 text-xs">
                  <div className="bg-gray-50 p-2 rounded">
                    <p className="text-gray-500">Created</p>
                    <p className="font-bold">{new Date(req.created_date).toLocaleDateString()}</p>
                  </div>
                  <div className="bg-gray-50 p-2 rounded">
                    <p className="text-gray-500">Expected</p>
                    <p className="font-bold">{req.expected_resolution_days} days</p>
                  </div>
                  <div className="bg-gray-50 p-2 rounded">
                    <p className="text-gray-500">Department</p>
                    <p className="font-bold text-xs">{req.city_department.substring(0, 20)}</p>
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default StatusTracker;
